const Searchbar = () => {
  return (
    <div>
      <h2 className=''>Hello World</h2>
      <div className='m-5'>
        <input
          type='text'
          placeholder='Search'
          className='bg-gray-50 border border-gray-300 text-gray-900 text-sm rounded-xl pl-5 p-2 block w-full max-w-lg m-auto'
        />
      </div>
    </div>
  );
};

export default Searchbar;
